function leftContainerJSON(t){var n,s;n='<h3 class="fd-panel__title">'+t.title+"</h3>",n+='<p class="fd-panel__description">'+t.description+"</p>",$(n).appendTo("#leftContainer .fd-panel__head"),$.each(t.items,function(){var t;t='<li class="fd-list__item">',t+='   <span class="fd-list__title">'+this.name+" ["+this.id+"]</span>",t+='   <span class="fd-list__secondary fd-has-color-status-'+this.statusColor+'">'+this.status+"</span>",t+="</li>",$(t).appendTo("#leftContainer .fd-list")}),s='<li class="fd-list__footer">'+t.items.length+"&nbsp;"+t.title+" loaded successfully.</li>",$("#leftContainer .fd-list").append(s)}function getLeftContainerData(t){$.ajax({dataType:"json",url:t+"/src/json/leftContainer.min.json",success:leftContainerJSON,error:function(){console.log("No left container JSON found.")},complete:function(){console.log("Left container JSON loaded.")}})}